    function createWorkbook(creator) {

        workbook.lastPrinted = new Date(2020, 02, 25)

        workbook.calcProperties.fullCalcOnLoad = true

    function createWorkSheet(name) {
        workbook.addWorksheet(name);
    }

        //Append some date field
        var worksheet = workbook.getWorksheet(worksheet)
        var cell = worksheet.getCell(cellId)
    }

    function downloadWorkbook() {
        workbook.xlsx.writeBuffer({
            base64: true
        })
            .then(function (xls64) {
                // build anchor tag and attach file (works in chrome)
                var a = document.createElement("a");
                var data = new Blob([xls64], { type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet" });

                var url = URL.createObjectURL(data);
                a.href = url;
                a.download = "export.xlsx";
                document.body.appendChild(a);
                a.click();
                setTimeout(function () {
                    document.body.removeChild(a);
                    window.URL.revokeObjectURL(url);
                },
                    0);
            })
            .catch(function (error) {
                console.log(error.message);
            });

    }

    createWorkbook('Sigurd')
    createWorkSheet('Main')
    writeCellValue('Main', 'C3', new Date(1968, 5, 1))
    writeCellImage('Main', 'C4:E6', 'base54data')
    downloadWorkbook();

</script>
